import React from "react";
import Card from "../Card/Card";

const Board = () => {
  return (
    <div className="container-">
      <div className="row">
        <div className="col-4">
          <Card />
        </div>
        <div className="col-4">
          <Card />
        </div>
        <div className="col-4">
          <Card />
        </div>
      </div>
    </div>
  );
};

export default Board;
